def threads_ip(thread_num, txt_path):
    """
    多线程
    :param thread_num:
    :return:分片处理，结果写入csv
    """
   #处理csv文件
    with open(txt_path, "r", encoding='utf-8') as f:
        reader = csv.DictReader(f)
        rows = [row for row in reader]
    per_num = int(len(rows)/thread_num)
    threads = []
    for i in range(thread_num):
        t = threading.Thread(target=ip_csv, args=(rows[i*per_num:i*per_num+per_num],txt_path))
        threads.append(t)
    for t in threads:
        t.setDaemon(True)
        t.start()
    for t in threads:
        t.join()


